import { useEffect, useState } from 'react';
import { Movie } from '../types/movie';

function HiltonMovieList() {
  const [movieData, setMovieData] = useState<Movie[]>([]);

  useEffect(() => {
    const fetchMovies = async () => {
      const rsp = await fetch('https://localhost:4000/movie');
      const data = await rsp.json();
      setMovieData(data);
    };
    fetchMovies();
  }, []);

  return (
    <>
      <div className="row">
        <h4>Joel Hilton Movie Collection</h4>
      </div>
      <table className="table table-bordered">
        <thead>
          <tr>
            <th>Category</th>
            <th>Title</th>
            <th>Year</th>
            <th>Director</th>
            <th>Rating</th>
            <th>Edited</th>
            <th>Lent To</th>
            <th>Notes</th>
          </tr>
        </thead>
        <tbody>
          {movieData.map((movie) => (
            <tr key={movie.MovieId}>
              <td>{movie.Category}</td>
              <td>{movie.Title}</td>
              <td>{movie.Year}</td>
              <td>{movie.Director}</td>
              <td>{movie.Rating}</td>
              <td>{movie.Edited}</td>
              <td>{movie.LentTo}</td>
              <td>{movie.Notes}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </>
  );
}

export default HiltonMovieList;
